Como funciona o vip: 

Iago é autoridade na leitura do ALGORITIMO do jogo Aviator e com isso vem tendo grandes resultados a mais de 1 ano onde ele compartilhava apenas com os amigos aproximos. 

Há 6 meses atrás ele decidiu passar a compartilhar com mais pessoas e criou-se a rotina de fazer Lives fechadas todos os dias ao vivo. O negócio tomou proporção e houve a necessidade de contratar funcionários e montagem de estrutura para fazer um trabalho organizado. 

Hoje a Lista vip + Live + Mentoria Diária está custado o preço de um Sorvete e por apenas R$12,90 você pode garantir seu acesso e alavancar sua banca todos os dias ao lado de quem sabe! 

